Given the complexity and the need for precise querying, a SPARQL query would look something like this:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia: <http://dbpedia.org/ontology/>

SELECT ?spouse
WHERE {
  <http://dbpedia.org/resource/Antiochus_(son_of_Antiochus_III_the_Great)> 
    rdf:type dbpedia:Successor;
    dbpedia:child [
        rdf:type dbpedia:Royalty
    ] ;
    dbpedia:child [
        rdf:type dbpedia:Royalty
    ] named-as ?child1.
  ?child1 rdf:type dbpedia:Royalty.
  <http://dbpedia.org/resource/Antiochus_II_Theos> 
    rdf:type dbpedia:Successor;
    dbpedia:child [
        rdf:type dbpedia:Royalty
    ] named-as ?child2.
  ?child2 rdf:type dbpedia:Royalty.
  ?child1 dbpedia:spouse ?spouse.
}
```

This query attempts to follow the lineage and identify the spouse of Antiochus (son of Antiochus III the Great) through his child who is also a royalty, and then trace back to Antiochus II Theos to confirm the familial connection.

